import Booklist from './components/Booklist';
import Button from './components/ButtonToggle';

class App extends Component {
  render(){
    return (
      <ThemeContextProvider>
      <div className="App">
           <NavBar/>
           <Booklist/> 
           <Button/>

      </div>

      </ThemeContextProvider>


    );
  }

}

export default App;
